    public List<AssetPurchasedEventResponse> getAssetPurchasedEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(ASSETPURCHASED_EVENT, transactionReceipt);
        ArrayList<AssetPurchasedEventResponse> responses = new ArrayList<AssetPurchasedEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            AssetPurchasedEventResponse typedResponse = new AssetPurchasedEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.registrar = (String) eventValues.getIndexedValues().get(0).getValue();
            typedResponse.assetSold = (BigInteger) eventValues.getIndexedValues().get(1).getValue();
            typedResponse.buyer = (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.seller = (String) eventValues.getNonIndexedValues().get(1).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

